const Home: React.FC = () => {
  const handleFetchBooks = () => {
    setLoading(true);

    fetchBooks(page, category, auth)
      .then((res) => {
        setTotalPages(Math.ceil(res.data.totalPages));
        setBooks(res.data.data);
        setLoading(false);
      })
      .catch((error) => {
        console.log(error);
        setLoading(false);
      });
  };

